import React, { Component } from 'react';
import Comment from './Comment';

class Comments extends Component {

    render() {
    console.log(props);
        const { comments, deleteComment } = this.props
        const listComments = comments.map(comment => {
            return(
                <Comment
                    key={comment.id} 
                    comment={comment} 
                 />
                ) 
            }
        )

        return(
            <div>
                {listComments}
            </div>
        )
    }
}

export default Comments;


